import React from 'react';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  // Existing styles...

  ourWorksSection: {
    marginTop: '100px',
    marginBottom: '75px',
  },
  sliderContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    marginBottom: '50px',
  },
  slider: {
    width: '30%',
  },
};

const OurWorksSlider = () => (
  <div style={styles.slider}>
    {/* Your slider component goes here */}
  </div>
);

const CombinedSliders = () => (
  <div style={styles.slider}>
    {/* Your combined sliders component goes here */}
  </div>
);

const OurWorksSection = () => (
  <div style={styles.ourWorksSection}>
    <h2>Our Works</h2>
    <div style={styles.sliderContainer}>
      <OurWorksSlider />
      <OurWorksSlider />
      <OurWorksSlider />
    </div>
    <CombinedSliders />
  </div>
);

const App = () => (
  <div style={styles.app}>
    <Header />
    <NavBar />
    <AboutSection />
    <OurWorksSection />
    {/* Include other components and sections as needed */}
  </div>
);

export default App;
